import styled from 'styled-components';

export const Nav = styled.nav`
    display: flex;
    position: fixed;
    background: #fff;
    padding: 0 2.4rem;
`;

export const Title = styled.a.attrs({
    href: "/"
})`
    color: tomato;
    height: 2.93rem;
    width: 14.67rem;
    
`;
